body:
curl -X POST \
https://www.wixapis.com/subscription-service/v1/subscribe \
-H 'Authorization: <AUTH>'
-d '{
  "asset": {
    "type": "EMAIL",
    "email": "test@test.com"
  },
  "lastConsentInfo": {
    "appDefId": "someAppDefId",
    "source": "FACE_TO_FACE",
    "description": "person filled a printed document",
    "update_date": {
        "seconds": 10022,
        "nanos": 1
    }
    "opt_in_level": "SINGLE"
  }
}'

curl -X POST \
https://www.wixapis.com/subscription-service/v1/upsert \
-H 'Authorization: <AUTH>'
-d '{
  "asset": {
    "type": "EMAIL",
    "email": "test@test.com"
  },
  "state": "PENDING",
  "lastConsentInfo": {
    "appDefId": "someAppDefId",
    "source": "FACE_TO_FACE",
    "description": "person filled a printed document",
    "update_date": {
        "seconds": 10022,
        "nanos": 1
    },
    "opt_in_level": "CONFIRMED"
  }
}'

